import "./Carousel.css"
import React from 'react';
import Carousel from 'react-elastic-carousel';
import Item from "../components/Item";





const imgslider = () => {
  return (
    <>
        <h1>Example</h1>
        <div className="Carousel">
            <Carousel>
                <Item>One</Item>
                <Item>One</Item>
                <Item>One</Item>
                <Item>One</Item>
            </Carousel>

        </div>
    </>
  )
}

export default imgslider
